import { useState } from "react";


const filterCars = (cars, setCars) => {
        const result = cars.filter((curCars)=>{
            return curCars.category ===cars.category  &&  curCars.subcategory===cars.seats; 
        })
        setCars(result);

};

export default filterCars;
